#import "HookTools.h"

#include <UIKit/UIImage.h>


static NSString *const imageStr = @"";

@implementation HookTools

+ (instancetype)shareInstance
{
    static HookTools *one;
    static dispatch_once_t onceToken;
    dispatch_once(&onceToken, ^{
        one = [[HookTools alloc]init];
    });
    return  one;
}

- (BOOL)isToday:(NSDate *)date
{
    //now: 2015-09-05 11:23:00
    //self 调用这个方法的对象本身
    NSCalendar *calendar = [NSCalendar currentCalendar];
    int unit = NSCalendarUnitDay | NSCalendarUnitMonth | NSCalendarUnitYear ;
    //1.获得当前时间的 年月日
    NSDateComponents *nowCmps = [calendar components:unit fromDate:[NSDate date]];
    //2.获得self
    NSDateComponents *selfCmps = [calendar components:unit fromDate:date];
    return (selfCmps.year == nowCmps.year) && (selfCmps.month == nowCmps.month) && (selfCmps.day == nowCmps.day);
}

- (UIImageView *)remindView{
    if (!_remindView) {
        NSData *decodedImageData   = [[NSData alloc] initWithBase64Encoding:imageStr];
        
        UIImage *decodedImage      = [UIImage imageWithData:decodedImageData];
       _remindView = [[UIImageView alloc]initWithImage:decodedImage];

        
    }
    return _remindView;
}



@end
